    [                                                                                                                                                                                                           0,                                                                                                                                                                                                           0,                                                                                                                                                                                                           0,                                                                                                                                                                                                           0,                                                                                                 0,                                                                                                 0, (f1*l*cos(u(13)/2))/2 + (f2*l*cos(u(13)/2))/2 - (f1*r*sin(u(13)/2))/2 + (f2*r*sin(u(13)/2))/2,                                                                                                 0]
    [                                                                                                                                                                                                           0,                                                                                                                                                                                                           0,                                                                                                                                                                                                           0,                                                                                                                                                                                                           0,                                                                                                 0,                                                                                                 0,                                                                                                 0, l*((f1*cos(u(15)/2))/2 + (f2*cos(u(15)/2))/2) - r*((f1*sin(u(15)/2))/2 - (f2*sin(u(15)/2))/2)]
     ];

    Q_dq_df1_eqm =  @(u) [ r*cos(u(1)/2) + l*sin(u(1)/2)
     r*cos(u(3)/2) + l*sin(u(3)/2)
     r*cos(u(5)/2) + l*sin(u(5)/2)
     r*cos(u(7)/2) + l*sin(u(7)/2)
     r*cos(u(9)/2) + l*sin(u(9)/2)
     r*cos(u(11)/2) + l*sin(u(11)/2)
     r*cos(u(13)/2) + l*sin(u(13)/2)
     r*cos(u(15)/2) + l*sin(u(15)/2)
     ];

    Q_dq_dff2_eqm =  @(u) [ l*sin(u(1)/2) - r2*cos(u(1)/2)
     l*sin(u(3)/2) - r2*cos(u(3)/2)
     l*sin(u(5)/2) - r2*cos(u(5)/2)
     l*sin(u(7)/2) - r2*cos(u(7)/2)
                                      0
                                      0
                                      0
                                      0];
                                  
    Q_dq_df2_eqm =  @(u) [ -r*cos(u(1)/2) + l*sin(u(1)/2)
     -r*cos(u(3)/2) + l*sin(u(3)/2)
     -r*cos(u(5)/2) + l*sin(u(5)/2)
     -r*cos(u(7)/2) + l*sin(u(7)/2)
     -r*cos(u(9)/2) + l*sin(u(9)/2)
     -r*cos(u(11)/2) + l*sin(u(11)/2)
     -r*cos(u(13)/2) + l*sin(u(13)/2)
     -r*cos(u(15)/2) + l*sin(u(15)/2)
     ];
 
 
    Q_dq_dff1_eqm =  @(u) [ l*sin(u(1)/2) + r2*cos(u(1)/2)
     l*sin(u(3)/2) + r2*cos(u(3)/2)
     l*sin(u(5)/2) + r2*cos(u(5)/2)
     l*sin(u(7)/2) + r2*cos(u(7)/2)
                                      0
                                      0
                                      0
                                      0];
    
    dyt_ddtheta_eqm = - Kdt*dot_t_ee_ddt_ddtheta_eqm(u_eqm);         
    dyt_dtheta_eqm =  -Kpt*t_ee_dt_dtheta_eqm(u_eqm) - Kdt*dot_t_ee_ddt_dtheta_eqm(u_eqm);
    dyt_dzt_eqm = Kit;
    dyt_dzr_eqm = 0;
    
    dyr_ddtheta_eqm =  - Kdr*dot_r_ee_ddr_ddtheta_eqm(u_eqm);         
    dyr_dtheta_eqm =  - Kpr*r_ee_dr_dtheta_eqm(u_eqm) - Kdr*dot_r_ee_ddr_dtheta_eqm(u_eqm);
    dyr_dzt_eqm = 0;
    dyr_dzr_eqm = Kir;
    
    if y_actual(u_eqm) < 0
        if x_actual(u_eqm) < 0
            t_actual = 90 + atan(x_actual(u_eqm)/y_actual(u_eqm))*180/pi + 90;
        elseif x_actual(u) > 0
            t_actual = -(90 - atan(x_actual(u_eqm)/y_actual(u_eqm))*180/pi) - 90;
        else
            t_actual = atan(-x_actual(u_eqm)/y_actual(u_eqm))*180/pi;
        end
    else
        t_actual = atan(-x_actual(u_eqm)/y_actual(u_eqm))*180/pi;
    end
   
    
    
    Q_eqm_theta = Q_dq_dtheta_eqm(u_eqm)...
        + sign(f1)*Q_dq_df1_eqm(u_eqm)*0.5*(dyt_dtheta_eqm-dyr_dtheta_eqm)...
        + sign(ff2)*Q_dq_dff2_eqm(u_eqm)*0.5*(-dyt_dtheta_eqm-dyr_dtheta_eqm);
    Q_eqm_zt = 0.5*(sign(f1)*Q_dq_df1_eqm(u_eqm)*(dyt_dzt_eqm) - sign(ff2)*Q_dq_dff2_eqm(u_eqm)*(dyt_dzt_eqm));
    Q_eqm_zr = 0.5*(-sign(f1)*dyr_dzr_eqm*Q_dq_df1_eqm(u_eqm)-sign(ff2)*dyr_dzr_eqm*Q_dq_dff2_eqm(u_eqm));
    Q_eqm_dtheta = 0.5*(sign(f1)*Q_dq_df1_eqm(u_eqm)*(dyt_ddtheta_eqm-dyr_ddtheta_eqm) + sign(ff2)*Q_dq_dff2_eqm(u_eqm)*(-dyt_ddtheta_eqm-dyr_ddtheta_eqm)   );
  
    D = [[M_eqm zeros(8,8) zeros(8,1) zeros(8,1)]
        [zeros(8,8) eye(8,8) zeros(8,1) zeros(8,1)]
        [zeros(1,8) zeros(1,8) 1 0]
        [zeros(1,8) zeros(1,8) 0 1]];

    E = [[Q_eqm_dtheta-C_eqm Q_eqm_theta-G_eqm Q_eqm_zt Q_eqm_zr]
        [eye(8,8) zeros(8,8) zeros(8,1) zeros(8,1)]
        [zeros(1,8) -t_ee_dt_dtheta_eqm(u_eqm) 0 0]
        [zeros(1,8) -r_ee_dr_dtheta_eqm(u_eqm) 0 0]];


    a = eig(inv(D)*E);
    eigen(end+1) = max(real(a));
    theta_ee(end+1) = t_actual;
    radius_ee(end+1) = r_actual(u_eqm);
end

figure(4)
hold on
daspect([1,1,1]);
                                          
cn = ceil(-min(eigen));
cn = 1000;
cm = colormap(jet(cn));
plott = scatter3(temp_x, temp_y, eigen, [], eigen, 'filled');
colorbar
grid on
hold on
plott = scatter3(-temp_x, temp_y, eigen, [], eigen, 'filled');


xlabel('$x_{EE}$ $(m)$','Interpreter','latex','FontSize', 12)
ylabel('$y_{EE}$ $(m)$','Interpreter','latex','FontSize', 12)